import React from "react";
import {Route, Switch} from "react-router-dom";
import Home from "./Home"


function Routes(){
	return (
		<Switch>
			<Route exact path="/Home"><Home/></Route>
			<Route exact path="/dogs/:dog"><Detail/></Route>
		</Switch>
	);
}

export default Routes;
